INSERT INTO `pages` (`id`, `type`, `text`, `created_at`, `updated_at`) VALUES
(1, 'Terms & Conditions', '<p><strong>1. Service Agreement</strong></p><p>&nbsp; Our detailing services include exterior washing and interior cleaning.</p><p>&nbsp; Additional options may be available upon request.</p><p><br></p><p><strong>2. Pricing &amp; Payments</strong></p><p>&nbsp; Prices are non-negotiable.</p><p>&nbsp; Payment is due at the time of service.</p><p><br></p><p><strong>3. Liability Disclaimer</strong></p><p>&nbsp; We do everything in our power to ensure that no damage to the vehicle occurs during the detailing process.</p><p>&nbsp; Any claims of damage to the vehicle as a result of our work must be declared immediately upon completion of services.</p><p><br></p>', '2025-05-01 08:48:33', '2025-06-30 04:05:02'),
(2, 'Privacy Policy', '<p>Inspired by personal resilience and a commitment to clear communication, we deliver meticulous auto detailing services that reflect dedication, precision, and care. By empowering customers through seamless interactions and exceptional results, we strive not only to enhance vehicles but also to enrich connectionsbringing every service experience full circle.Most of our profits are donated to community schools. We thank you for your business.</p>', '2025-05-01 08:48:33', '2025-06-30 04:04:56'),
(3, 'About Us', '<p> At FULL CIRCLE Detailing, your privacy is important to us. We collect only the information necessary to schedule and complete your service, such as your name, contact information, and vehicle details.</p><p> We will not sell, rent, or share your personal information with any third parties. Your information will be used solely for communication, service delivery, and internal business operations.</p><p> We are committed to protecting your data and maintaining your trust. If you have any questions about our privacy practices, please feel free to contact us.</p><p></p>', '2025-05-01 08:48:33', '2025-06-30 04:03:21'),
(4, 'demo', 'dsfjsadkfjlksdajfklsadjfsadfsadfsafs', '2025-06-12 03:24:41', '2025-06-12 03:24:41');
